import { Box } from "@material-ui/core";

export default ({ state }) => (
  <Box height="500px" bgcolor="grey.300">
    {state ? (
      <Box>
        <img
          style={{ height: "auto",  maxWidth: "100%" }}
          src={state.results[0].picture.large}
        />
      </Box>
    ) : (
      <Box>NO DATA SELECTED</Box>
    )}
  </Box>
);
